function App() {

  const onSubmit = ()=>{
    alert('submitted');
  }



  return (
    <div className="App">
      <input placeholder = 'Username'/><br />
      <input placeholder = 'Password'/><br />
      <button onClick={onSubmit}>Login</button>
    </div>

  );
}

export default App;
